import React from 'react'


const Header = (props) => {
  return <div>
<h1>{props.name}</h1>
  </div>;
};


const Part = (props) => {
  return <div>
  <p>{props.part} {props.exercises}</p>
  </div>
}



const Content = (props) => {
  return <div>
  </div>;
};


const Total = (props) => {
  return <div>
    <p>Number of exercises {props.a + props.b + props.c}</p>
  </div>;
};

const App = () => {
  const course = 'Half Stack application development'
  const parts = [
    {
      name: 'Fundamentals of React',
      exercises: 10
    },
    {
      name: 'Using props to pass data',
      exercises: 7
    },
    {
      name: 'State of a component',
      exercises: 14
    }
  ]


  return (
    <div>
      <Header name={course} />
      <Content />
      <Total />
    </div>
  )
}

export default App
